import style from './Post.module.css'

const Post = () => {
    return <div className={style.profile}>
        <div className={style.item}>
            <img src="https://filmix.co/uploads/frames/6241/f222903-avatar-2009_original.jpg" alt=""/>
            Comment 1
            <span>Like</span>
        </div>
    </div>
}

export default Post;
